<!DOCTYPE html>
        <html>
        <head>
            <meta charset="UTF-8">
            <meta name="viewport" content="width=device-width, initial-scale=1.0">
            <title>ASCII Animation</title>
            <style>
            
            @font-face {
                font-family: "Myfontascii";
                src: url('Myfontascii-Regular.ttf') format('truetype'); /* Şimdilik sadece ttf varsayıyoruz */
            }
            
            body {
                margin: 0; /* Body margin'ini sıfırla */
                display: flex; /* Ana container'ı ortalamak için */
                justify-content: center;
                align-items: center;
                min-height: 100vh; /* Tam ekran yüksekliği */
                background-color: #120A18; /* Arkaplanı body'ye taşı */
                overflow: hidden; /* Sayfa taşmasını da engelleyelim */
            }
            .ascii-container {
                font-family: 'Myfontascii', monospace; /* Ayarlanan font */
                display: flex; /* İçeriği (grid) sarması için flex yeterli */
                overflow: visible; /* Taşmaları engelle */
                width: 100vw; /* Veya sığdırmak istediğin başka bir boyut */
                height: 100vh;
                max-width: calc(95vh * (30/40)); /* En boy oranını koru (genişlik yüksekliğe göre) */
                max-height: calc(95vw * (40/30)); /* En boy oranını koru (yükseklik genişliğe göre) */
            }
            .ascii-grid {
                display: grid;
                grid-template-columns: repeat(30, 1fr); /* Eşit sütunlar */
                grid-template-rows: repeat(40, 1fr);    /* Eşit satırlar */
                gap: 0;
                width: 100%; /* Container'ı doldur */
                height: 100%; /* Container'ı doldur */
            }
            .ascii-char {
                display: flex;
                align-items: center;
                justify-content: center;
                /* width: 3.3333333333333335vw;  Grid hücresi boyutunu alır */
                /* height: 2.5vh; Grid hücresi boyutunu alır */
                overflow: visible; /* Karakter taşabilir */
                white-space: nowrap;
                line-height: 1;
                width: 100%;  /* ÖNEMLİ: Hücre genişliğini tam doldur */
                height: 100%; /* ÖNEMLİ: Hücre yüksekliğini tam doldur */
                min-width: 0; /* ÖNEMLİ: İçeriğin minimum genişliği etkilemesini engelle */
                min-height: 0; /* ÖNEMLİ: İçeriğin minimum yüksekliği etkilemesini engelle */
                /* font-size: 1vmin; /* Veya hücre boyutuna göre dinamik ayarlanabilir */
            }
        </style>
        </head>

            // --- IFRAME KONTROL DEĞİŞKENLERİ ---
            let animationRunning = true;
            let timeoutId = null;

            // --- IFRAME KONTROL FONKSİYONLARI ---
            function startAnimation() {
                if (!animationRunning) {
                    console.log('iframe: Animation started');
                    animationRunning = true;
                    animate(); // Animasyonu kaldığı yerden devam ettir
                }
            }

            function stopAnimation() {
                if (animationRunning) {
                    console.log('iframe: Animation stopped');
                    animationRunning = false;
                    if (timeoutId) {
                        clearTimeout(timeoutId);
                        timeoutId = null;
                    }
                }
            }

            function sendHeight() {
                // Yüksekliği body veya container üzerinden gönder
                const height = document.documentElement.scrollHeight || document.body.scrollHeight;
                console.log('iframe: Sending height:', height);
                // '*' yerine ana sayfanın origin'ini kullanmak daha güvenlidir
                // Örn: parent.postMessage({ type: "resize", height: height }, 'https://ana-sayfaniz.com');
                parent.postMessage({ type: "resize", height: height }, "*");
            }

            // --- IFRAME MESAJ DİNLEYİCİLERİ ---
            window.addEventListener("message", (event) => {
                // Güvenlik için event.origin kontrolü eklenebilir
                // if (event.origin !== 'https://ana-sayfaniz.com') return;

                if (event.data === "requestHeight") {
                    console.log('iframe: Height request received');
                    sendHeight();
                } else if (event.data === "toggle") {
                    console.log('iframe: Toggle request received');
                    animationRunning ? stopAnimation() : startAnimation();
                } else if (event.data === "pause") {

                     stopAnimation();
                } else if (event.data === "play") {
                     console.log('iframe: Play request received');
                     startAnimation();
                }
